import React from "react";

const Home = () => {
  return (
    <div className="d-flex justify-content-center align-items-center vh-100 bg-success">
      <div className="card p-4 shadow" style={{ maxWidth: "600px", width: "100%" }}>
        {/* Logo */}
        <div className="text-center mb-4">
          <img
            src="/images/logosdc.jpg" // Ruta de la imagen
            alt="Logo"
            className="img-fluid"
            style={{ maxWidth: "200px" }}
          />
        </div>

        {/* Título */}
        <h2 className="text-center mb-4">Agenda de Trabajos</h2>

        {/* Botones */}
        <div className="d-flex justify-content-around flex-wrap gap-2">
          <button className="btn btn-outline-secondary">Agregar Trabajos</button>
          <button className="btn btn-outline-secondary">Amojonamientos</button>
          <button className="btn btn-outline-secondary">Arroz topografía</button>
          <button className="btn btn-outline-secondary">Agrimensura trámites</button>
        </div>
      </div>
    </div>
  );
};

export default Home;
